        jTextArea2.setColumns(20);
        jTextArea2.setRows(5);
        jTextArea2.setText("Question. Once I am registered with TPO, what do I need to do?\nAnswer : You must update your marks in TPO data sheet as and when your results are out. You need to updates your data in your account \n         and need to talk to the coordinators of your branch for the same. You also need to regularly visit notice board for upcoming \n        companies.\n\nQuestion. How can I know when the company is coming for recruitment?\nAnswer : All the details regarding the upcoming companies along with their eligibility criteria will be put up on the placement notice\n         board and u will get updates through placement website before at least two days prior to the date of campus. So you need to \n         regularly visit the placement cell notice board or your account on website.\n\nQuestiom. What do I need to carry on the day of placement?\nAnswer : You need to carry following things on the day of placement. \n         ï¿½ Hard and soft copies of your resume. \n         ï¿½ Your passport size photographs. \n         ¿½ All your credentials. (This file all your original mark sheets, certificates, testimonials etc.) \n         ï¿½ At least one copy of all the above mentioned credentials (You can also keep a soft copy containing all your credentials). \n         ï¿½ A water bottle, a stapler, a fevistick/gum, u-pins, few blank pages, a good quality pen etc. \n         Besides this, you compulsorily need to be dressed in formals otherwise you will not be allowed in the placement process.\n\nQuestion: I am a final year CSE student. Within one month campus placements will be started, but I am not feeling confident. What should I do?\n          According to previous statistics placement condition is good in college. Most of students get placed every year. I am practicing \n          coding and good at it but not feeling confident and always feel that I don't know anything. And if I wont get placed in on \n          campus then what are other ways for me?\n\nAnswer: If you are still gunning for a coding job, I suggest focusing on one language ( and that is invariably C when it's placement time ), \n        brushing up the fundamentals and going through the algorithms course material again. 99.99% of the jobs which do have a coding test \n       won't ask you to write competition level code, they will be more interested to see if you have a good grasp of the fundamentals.\n\n        If you are unfortunate to get placed, I suggest pinging your contacts for an offer ( it's called an off-campus in KGP ). If that doesn't work, you may consid-\n        er higher studies and prepare for exams such as GRE, CAT etc. If you have an entrepreneurial bend, try launching your own startup, again it doesn't have to be\n        a tech or IT startup just because you are a CS student.\n\nQuestion: What happens to people who don’t get placed in campus recruitment?\n          How do they deal with this situation;any experiences ? Is it the end of everything ? If you have any experience do share all points of view.\n\nAnswer: : I have done my B.Tech in civil from NIT Calicut. I didn't get placed through campus placements.\n          The time span from may'14 to dec'15 will always be a duration of huge Topsy- turvy in my life, huge high and lows.  Journey to Delhi was not a planned deci-\n          sion but an escape from  parents and their questions such as \"what I will do now, why don't I try for T.C.S\"?. My college, one of the best among NITs had l-\n          eft me \"educated unemployed\". Delhi was also not easy on me. Guys there ate,slept and shit study, all of this with an aim to hit the bulls eye. But I was t-\n          ired/demotivated/ashamed and it needed more than a mere motivation to change my fate. You see motivation doesn't give you rank.Someone had aptly said \"when\n          I had nothing I found myself\".\n\nQuestion: How was the placement of first batch of this university?\n\nAnswer: Hello? What's the point in asking about the placement statistics of the first batch! If you are keen enough then you should be \n        inquiring about present placement statistics which are quite good enough!\n\nQuestion: What strategy would a placement coordinator of an engineering college follow to contact and convince companies to come for \n         campus recruitment in India?\n\nAnswer: Step 1: Get as many names of companies as possible on your wish list.\n        Step 2: Contact the company. You'll get the numbers from their website and work your way up to talk to the concerned HR.\n        Step 3: Talk about your college, your branch and impress him. Use your marketing skills.\n        Step 4: Get his or her email Id and and go about officially through discussing it through your placement department if they show\n                interest.");
        jScrollPane7.setViewportView(jTextArea2);

